def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 20:
        raise ValueError("Input length must be between 1 and 20")

    if not all(c in {'t', 'f', '|', '&'} for c in input1):
        raise ValueError("Input contains invalid characters")

